// src/pages/myPage/myPage.js
import React from 'react';
import MyPageHeader from './myPage_header';
import MyPageCategory from './myPage_category';
import MyPageMenu from './myPage_menu';
import MyPageProfile from './myPage_profile';
import '../../css/myPage/myPage.css'; // ✅ 새 CSS에서 전체 레이아웃 정리

function MyPage() {
  return (
    <div>
      <MyPageHeader />
      <MyPageCategory />
      <div className="mypage-content">
        <MyPageMenu />
        <MyPageProfile />
      </div>
    </div>
  );
}

export default MyPage;
